import './meetstyle/App.css';

import React from 'react';
import PDFViewer from './PDFViewer';
function App() {
  const pdfUrl = 'https://ahse.cc/wnj.pdf';
  return (
    <div>
      <PDFViewer url={pdfUrl} />
    </div>
  );
}

export default App;
